const Channels = ({ setChannel }) => {
  return (
    <aside className="channel">
      <div className="stock-app">
        <h4>Channel 0</h4>
        <p>
          A stock portfolio web app that lets users track stock holdings over
          time and read news
        </p>
      </div>
    </aside>
  );
};

export default Channels;
